window.bookSummaryJSON = "<p>From The #1 best-selling author of <i>Wood's Reef</i>, Wood's Wall &amp; Bonefish Blues comes a new Mac Travis AdventureIf you like Clive Cussler's Dirk Pitt and John D McDonald's Travis McGee check it out. </p> <p>Mac Travis went to the Florida Keys to disappear, but his new commercial diving job turns out to be more than he planned. An artifact discovered while working on a bridge pier quickly draws the attention of a real estate tycoon, a Jersey mobster and twin Indian Chiefs all trying to open a casino in the pristine Keys. When his psycho ex-girlfriend tracks him down things get even more interesting.</p>"; 
